import { Link } from 'react-router-dom';

const NotFoundPage = () => {
  return (
    <div>
      <h2>Sayfa Bulunamadı</h2>
      <p>Aradığınız sayfa bulunamadı.</p>
      <Link to="/">Ana Sayfaya Dön</Link>
    </div>
  );
};

export default NotFoundPage;
